processVariable.defaultValue:
var autoObject = new tw.object.listOf.InstancesSummary();
autoObject[0] = new tw.object.InstancesSummary();
autoObject

TWComponent.script:
var params, days, statuses, applications, statusin, appin;
if (tw.local.data){
params = tw.local.data.split("|");
days = params[0];
statuses = params[1].split("~");
applications = params[2].split("~");
statusin = "('" + statuses.join("','") + "')";
appin = "('" + applications.join("','") + "')";

}
tw.local.parameters[0] = new tw.object.toolkit.TWSYS.SQLParameter();
tw.local.parameters[0].type =  'VARCHAR';
tw.local.parameters[0].mode =  'IN';
tw.local.parameters[0].value = days;

tw.local.appIN = appin;
tw.local.statusIN = statusin;

